import React, { useEffect, useState } from "react";
import { GET_ALL } from "../api/apiService";
import startsActive from "../../assets/images/icons/pay-american-ex.png";
import startsDisable from "../../assets/images/icons/pay-bank.png";
import { Link } from "react-router-dom";
const cardTextStyle = {
  maxWidth: "80%",
};
const LoadProduct = (category) => {
  const { categoryName, categoryId } = category;
  const [products, setProducts] = useState([]);
  useEffect(() => {
    GET_ALL(`products/getlatest?categoryid=${categoryId}`).then((item) =>
      setProducts(item.data)
    );
  }, [categoryId]);
  return (
    <section class="padding-bottom">
      <header class="section-heading mb-4">
        <h3 class="title-section">{categoryName}</h3>
      </header>

      <div class="row large-columns-4 medium-columns-2 small-columns-2 row-small">
        {products.length > 0 &&
          products.map((row) => (
            <div
              class="product-small col has-hover out-of-stock product type-product post-61896 status-publish first outofstock product_cat-do-luu-niem-mixi has-post-thumbnail sold-individually shipping-taxable purchasable product-type-variable"
              key={row.id}
            >

              <div class="card card-product-grid">

                <Link
                  to={`/detailProduct?productId=${row.id}`}
                  class="img-wrap"
                >
                  <img src={`./images/items/${row.thumbnail}`} />
                </Link>
                <figcaption class="info-wrap">
                  <ul class="rating-stars mb-1">
                    <li style={{ cardTextStyle }} class="stars-active">
                      <img src={startsActive} alt="" />
                    </li>
                    <li>
                      <img src={startsDisable} alt="" />
                    </li>
                  </ul>
                  <div>
                    <Link
                      to={`/detailProduct?productId=${row.id}`}
                      class="title"
                    >
                      {row.title}
                    </Link>
                  </div>
                  <div class="price h5 mt-2">${row.price}</div>
                </figcaption>
              </div>
            </div>
          ))}
      </div>



<div class="badge-container absolute left top z-1">
</div>
	<div class="product-small box ">
		<div class="box-image">
			<div class="image-fade_in_back">


			<div class="image-tools is-small top right show-on-hover">
							</div>
			<div class="image-tools is-small hide-for-small bottom left show-on-hover">
							</div>
			<div class="image-tools grid-tools text-center hide-for-small bottom hover-slide-in show-on-hover">
							</div>
			<div class="out-of-stock-label">Hết hàng</div>		

		<div class="box-text box-text-products text-center grid-style-2">
			<div class="title-wrapper">		<p class="category uppercase is-smaller no-text-overflow product-cat op-7">
			ÁO MIXI		</p>
	<p class="name product-title woocommerce-loop-product__title"><a href="https://shop.mixigaming.com/san-pham/ao-phong-mixi-logo-den/" class="woocommerce-LoopProduct-link woocommerce-loop-product__link">Áo phông Mixi logo – Đen</a></p></div><div class="price-wrapper"><div class="star-rating" role="img" aria-label="Được xếp hạng 5.00 5 sao"><span style={{width:"100%"}}>Được xếp hạng <strong class="rating">5.00</strong> 5 sao</span></div>
	<span class="price"><span class="woocommerce-Price-amount amount"><bdi>250,000&nbsp;<span class="woocommerce-Price-currencySymbol">₫</span></bdi></span></span>
</div>		</div>
	</div>
		</div>
</div>
    </section>
  );
};
export default LoadProduct;
